import React from 'react';
import { Container, Card, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Home() {
    return (
        <Container className="text-center mt-4">
            <Card>
                <Card.Body>
                    <Card.Title>Welcome to the Point of Sale System</Card.Title>
                    <Card.Text>
                        Use the navigation bar to manage your products and view product listings.
                    </Card.Text>
                    <Button variant="primary" as={Link} to="/add-product">Add Product</Button>
                </Card.Body>
            </Card>
        </Container>
    );
}

export default Home;
